Chosen option: A. Markus Markus essentially meets all our required needs with a number of significant features that provide great benefit. Most StatsD libraries are not excessively complicated, in that the core functions of calling an increment, gauge, timer and histogram. Markus matches this need with added flexibility, in that you can define tags and filters when calling a given metric and define backends. Even though aiodogstatsd is used in Merino and we'd like to aim to use the same library across services, it is not the appropriate choice for Shepherd. We do not require asynchronous features. Since Merino runs on FastAPI, an asynchronous web-framework and Shepherd runs on Django, a synchronous web-framework, each respective choice is dictated by the architecture and service's needs. As a side note, aiodogstatsd is harder to test and has significantly fewer features than Markus when testing is concerned. This could hamper maintenance and development efficiency. Example: To return a MetricsInterface instance (with a specified prefix): get_metrics("shepherd")
markus.get_metrics(thing='', extra='', filters=None) thing is a prefix to use for keys extra adds bits to end of prefix filters, list of filters to apply Backends - A significant feature Markus has over other libraries is the ability to define metrics backends. It comes with the LoggingMetrics, LoggingRollupMetrics, StatsdMetrics, DatadogMetrics, CloudwatchMetrics by default, handling numerous configuration optimizations. You can also define your own backend. Example: Define markus.configure() and append backends, passing backends parameter as list of dicts. Each dict defines a backend. Can do datadog and logger configs, for example. Each backend has a class argument, options dict for configuration, filters list to apply to emitted metrics: Configure Markus’ backends using markus.configure(). For each Python module or class or however you want to organize it, you use markus.get_metrics() to get a markus.main.MetricsInterface. Use the various metrics reporting methods on the markus.main.MetricsInterface. import markus
from markus.filters import AddTagFilter markus.configure([ { "class": "markus.backends.logging.LoggingMetrics", "options": { "logger_name": "markus", "leader": "METRICS", } }
]) Filters - Markus lets you write filters to modify generated metrics on the fly. This allows infinite customization to drop or modify metric values before they are emitted. class DebugFilter(MetricsFilter): def filter(self, record): if "debug:true" in record.tags: return return record
